import React from 'react';
import Cell from './Board-cell'


class Board extends React.Component()
{
    constructor(props){
        super(props)
        this.state={
            next:'o',
            cells:[null,null,null,null,null,null,null,null,null]
        };

    }
    render()
    {
        return(
                 <div className="board">
                         <Cell id={0} value={this.state.cells[0]}/>
                         <Cell id={1} value={this.state.cells[0]}/>
                         <Cell id={2} value={this.state.cells[0]}/>
                         <Cell id={3} value={this.state.cells[0]}/>
                         <Cell id={4} value={this.state.cells[0]}/>
                         <Cell id={5} value={this.state.cells[0]}/>
                         <Cell id={6} value={this.state.cells[0]}/>
                         <Cell id={7} value={this.state.cells[0]}/>
                         <Cell id={8} value={this.state.cells[0]}/>
                 </div>
             );
    }
}





